DELIMITER $$
--
-- Procedimientos
--
CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_estadisticas_sanidad` (IN `fecha_desde` DATE, IN `fecha_hasta` DATE)   BEGIN
    SELECT 
        'Turnos por Estado' as tipo_estadistica,
        tm.estado as categoria,
        COUNT(*) as cantidad
    FROM turnos_medicos tm
    WHERE tm.created_at BETWEEN fecha_desde AND fecha_hasta
    GROUP BY tm.estado
    
    UNION ALL
    
    SELECT 
        'Turnos por Prioridad' as tipo_estadistica,
        tm.prioridad as categoria,
        COUNT(*) as cantidad
    FROM turnos_medicos tm
    WHERE tm.created_at BETWEEN fecha_desde AND fecha_hasta
    GROUP BY tm.prioridad
    
    UNION ALL
    
    SELECT 
        'Autorizaciones por Estado' as tipo_estadistica,
        am.estado as categoria,
        COUNT(*) as cantidad
    FROM autorizaciones_medicas am
    WHERE am.created_at BETWEEN fecha_desde AND fecha_hasta
    GROUP BY am.estado
    
    ORDER BY tipo_estadistica, cantidad DESC;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_internos_turnos_pendientes` ()   BEGIN
    SELECT 
        p.id,
        CONCAT(p.apellido, ', ', p.nombre) as nombre_completo,
        p.ci as dni,
        COUNT(tm.id) as turnos_pendientes,
        MIN(tm.fecha_turno) as proximo_turno
    FROM vista_internos_sanidad p
    INNER JOIN turnos_medicos tm ON p.id = tm.id_ppl
    WHERE tm.estado IN ('solicitado', 'confirmado', 'pendiente_estudios')
    AND p.estado_interno = 'activo'
    GROUP BY p.id, p.nombre, p.apellido, p.ci
    ORDER BY turnos_pendientes DESC, proximo_turno ASC;
END$$

DELIMITER ;

