--
-- Disparadores `turnos_medicos`
--
DELIMITER $$
CREATE TRIGGER `tr_turnos_medicos_insert` AFTER INSERT ON `turnos_medicos` FOR EACH ROW BEGIN
        `id_usuario`, `accion`, `tabla_afectada`, `registro_id`, 
        `detalles`, `nombre_archivo`, `correo`
    ) VALUES (
        COALESCE(NEW.usuario_carga, 1), 
        'Crear Turno Médico', 
        'turnos_medicos', 
        NEW.id,
        CONCAT('Turno creado para PPL ID: ', NEW.id_ppl, ', Especialidad: ', NEW.especialidad_id, ', Prioridad: ', NEW.prioridad),
        '',
        ''
    );
END
$$
DELIMITER ;
DELIMITER $$
CREATE TRIGGER `tr_turnos_medicos_update` AFTER UPDATE ON `turnos_medicos` FOR EACH ROW BEGIN
        `id_usuario`, `accion`, `tabla_afectada`, `registro_id`, 
        `detalles`, `nombre_archivo`, `correo`
    ) VALUES (
        COALESCE(NEW.usuario_carga, 1), 
        'Modificar Turno Médico', 
        'turnos_medicos', 
        NEW.id,
        CONCAT('Estado cambió de ', OLD.estado, ' a ', NEW.estado),
        '',
        ''
    );
END
$$
DELIMITER ;

